Hanuman Jayanti  ‚ù§‚ù§Hanuman jayanti, also called Hanuman Janmotsav,is a Hindu festival celebrating the birth of the Hindu deity, and one of the protagonists of the Ramayana and its many versions, Hanuman. The celebration of Hanuman Jayanti varies by time and tradition in each state of India. In most northern states of India, the festival is observed on the full-moon day of the Hindu month of Chaitra (Chaitra Purnima).In Telugu states Anjaneya Jayanthi celebrate on every Bahula (Shukla Paksha) Dashami in Vaishakha month according to Telugu calendar. In Karnataka, Hanuman Jayanti is observed on Shukla Paksha Trayodashi, during the Margashirsha month or in Vaishakha, while in a few states like Kerala and Tamil Nadu, it is celebrated during the month of Dhanu (called Margazhi in Tamil). Hanuman Jayanti is observed on Pana Sankranti in the eastern state of Odisha, which coincides with the Odia New Year.   
